import { Grid } from "@mui/material";
//import Feed from "../Feed/Feed";
import LeftBar from "../LeftBar/LeftBar";
import PollEventPage from "../Voting/User/PollEventPage";
import {BrowserRouter as Router, Route, Routes} from "react-router-dom";

import "./styles.css";
import Feed from "../Feed/Feed";

const AppBody = () => {
    return (
        <Grid container height={'100vh'} >
            <Grid item xs={2} borderRight= '1px solid #A9A9A9'>
                <LeftBar />
            </Grid>
            <Grid item className="grid-scroll" xs={10}>
                {/* <Feed /> */}
                {/* <PollEventPage /> */}

                <Router>
                    <Routes>
                        <Route exact path="/"> <Feed /> </Route>
                        <Route exact path="/polls" component={PollEventPage} />
                    </Routes>
                </Router>
            </Grid>
        </Grid>
    );
}

export default AppBody;
